import React, { useState } from 'react';
import './BottomNavigation.css';

const BottomNavigation = () => {
  const [isActive, setIsActive] = useState(false);

  const handleCenterClick = () => {
    setIsActive(!isActive);
    // Here you can add logic to open chat or navigate to main functionality
    console.log('Center button clicked - Open chat interface');
  };

  return (
    <div className="bottom-navigation">
      {/* Left Icon - Robot */}
      <div className="nav-icon left-icon">
        <div className="icon-container">
          <svg viewBox="0 0 24 24" className="robot-icon">
            <rect x="6" y="8" width="12" height="8" rx="2" fill="currentColor"/>
            <rect x="8" y="6" width="8" height="4" rx="2" fill="currentColor"/>
            <circle cx="10" cy="10" r="1" fill="#ffffff"/>
            <circle cx="14" cy="10" r="1" fill="#ffffff"/>
            <path d="M10 12h4" stroke="#ffffff" strokeWidth="1" strokeLinecap="round"/>
          </svg>
        </div>
      </div>

      {/* Center Button with Ripple Effect */}
      <div className="nav-center">
        <button 
          className={`center-button ${isActive ? 'active' : ''}`}
          onClick={handleCenterClick}
        >
          <div className="ripple-container">
            <div className="ripple ripple-1"></div>
            <div className="ripple ripple-2"></div>
            <div className="ripple ripple-3"></div>
          </div>
          <div className="center-icon">
            {/* Chat bubble icon */}
            <svg viewBox="0 0 24 24" className="chat-icon">
              <path d="M21 12c0 4.418-4.03 8-9 8-1.068 0-2.09-.152-3.04-.433-.313-.095-.641-.143-.969-.143-.445 0-.885.09-1.292.266l-2.32 1.003c-.53.229-1.104-.27-.973-.83l.576-2.46c.087-.37.131-.752.131-1.135 0-.41-.06-.818-.177-1.211C2.34 13.633 2 12.343 2 11c0-4.418 4.03-8 9-8s10 3.582 10 9z" fill="currentColor"/>
              <circle cx="8.5" cy="11.5" r="1" fill="#ffffff"/>
              <circle cx="12" cy="11.5" r="1" fill="#ffffff"/>
              <circle cx="15.5" cy="11.5" r="1" fill="#ffffff"/>
            </svg>
          </div>
        </button>
      </div>

      {/* Right Icon - Menu */}
      <div className="nav-icon right-icon">
        <div className="icon-container">
          <svg viewBox="0 0 24 24" className="menu-icon">
            <circle cx="12" cy="6" r="1" fill="currentColor"/>
            <circle cx="12" cy="12" r="1" fill="currentColor"/>
            <circle cx="12" cy="18" r="1" fill="currentColor"/>
          </svg>
        </div>
      </div>
    </div>
  );
};

export default BottomNavigation;
